import { LOGIN__FORM } from '../constants/actionTypes';
import axios from 'axios';

export const loginAction = value => async dispatch => {
  try {
    const response = await axios.post('http://52.76.240.170/login', value);
    console.log(response);
    if (!response.access_token) {
      console.log(response);
    }
    dispatch({
      type: LOGIN__FORM,
      payload: value
    });
  } catch (error) {
    console.log(error);
  }
};
